        "publishedAt": "2020-10-07T22:45:51Z",
        "channelId": "UCjgpFI5dU-D1-kh9H1muoxQ",
        "title": "4000° PLASMA PROTO-LIGHTSABER BUILD (RETRACTABLE BLADE!)",
        "description": "Download and play AFK Arena for free ► https://bit.ly/3cvZ7dB \nUse these bonus codes: BestRPG4BusyU and uf4shqjngq to get awesome rewards.\n\nBecome a Hacksmith member get exclusive perks, like watching our Lightsaber Test video right now! ►►► https://youtu.be/ey_EjSzKFWQ\nYou'll also get...\n►Project design files (CAD)!\n►Merch Discounts!\n►Collaborate with us on our videos!\n\nTry Altium Designer for Free and start designing your own PCBs ► https://www.altium.com/asp/hacksmith\nView & share electronic designs online ►https://www.altium.com/viewer/\n\nCheck out the circuit diagram at Maker.IO ► https://www.digikey.com/en/maker/projects/the-hacksmith-retractable-plasma-lightsaber/d14232ad19c4454ebdc1dd6bbaef5f78\n\nMake your own PCBs ► https://jlcpcb.com/  \n$2  2Layer 5PCBs!\n$5  4 Layer 5PCBs!\n\nEpic Starwars Music and more by Samuel Kim ► https://www.youtube.com/user/samuelkimmusic\n\nThe hilt design was inspired by multiple different renderings we found online, with some of the main inspiration from Adam Rzatkowski ► www.artstation.com/aionard\n\nSOCIAL\nWebsite ► http://www.hacksmith.tech\nFacebook ► http://www.facebook.com/thehacksmith\nInstagram ► http://www.instagram.com/thehacksmith\nTwitter ► http://twitter.com/thehacksmith\nPatreon ► http://www.patreon.com/thehacksmith\nDiscord ► https://discordapp.com/invite/thehacksmith \nMerch ► https://www.hacksmith.store\n\nCHAPTERS:\n0:00 Teaser\n0:33 A real retractable lightsaber\n3:28 New hilt design\n4:17 Support our channel!\n5:22 Building new hilt\n9:07 How does it work?\n12:00 Different blade colors?\n13:22 Electronics\n15:00 Powerpack\n16:27 World's First Retractable Lightsaber\n17:05 TEST!\n\nSOFTWARE:\nVideo Review / Collaboration ► http://r.frame.io/pZq3N\nVideo Editing ► Adobe Premiere \nVFX ► https://productioncrate.grsm.io/Hacksmith\nCAD ► Solidworks \nCAM ► Autodesk HSM http://bit.ly/HSMworks\n\nCAMERA GEAR:\nHighspeed Cam - Chronos 1.4 ► http://bit.ly/chronosCam\nMain shooter - Panasonic GH5s ► https://bhpho.to/2Fjd80N \nPhone - Samsung S10  ► https://bhpho.to/2N8FOh8\nCamcorder - Sony Handycam ► https://bhpho.to/2FDnq81 \nAction Cam - GoPro ► https://bhpho.to/2FxXDC4 \nSteadicam - Removu K1 ► https://bhpho.to/2N9lDQq \nMain mic - Sennheiser ► https://bhpho.to/2DsR8ec\nBendy Tripod ► https://bhpho.to/2FyLNb0 \nMain Tripods - old second hand Manfrotto tripods no longer sold. \nStudio Light - Luxli ► https://bhpho.to/2N9SPav\n\nTOOLS / MACHINES: \nCNC Waterjet Cutter ► http://bit.ly/wazerJet\nCNC Plasma Cutter ► http://bit.ly/EMTplasma\n3d Printers ► http://bit.ly/H1Printer\nCNC Mill ►  http://bit.ly/PCNC440\nCNC Lathe ► http://bit.ly/15LSlantPro\nLaser Cutter - Gweike LG900N 80W ► http://lmgtfy.com/?q=lg900n \n3d Scanner ► http://amzn.to/2pwbvTu\nDrills, drivers, grinders, saws, etc ► http://amzn.to/2p9SPJ3 \nMig Welder ► http://bit.ly/MP250iWelder\nTig Welder ► http://bit.ly/Tig200Welder\nQuiet Air Compressor ► http://bit.ly/38zVKzB\nDesktop PC ► https://youtu.be/gSbt3LK8hCs \n\nMUSIC IN ORDER OF APPEARANCE:\nBattle Of The Heroes X Duel Of Fates\nBy Samuel Kim\nhttps://www.youtube.com/c/samuelkimmusic \nhttps://twitter.com/samuelkimmusic \nhttps://www.instagram.com/samuelkimmusic \n\nWorlds Apart by G. Scott Russell\nLicensed from Triple Scoop Music ►\nhttps://triplescoopmusic.com/\n\nScorpion by Zac Nelson\nLicensed from Triple Scoop Music ►\nhttps://triplescoopmusic.com/\n\nKenobi Theme by Samuel Kim\n\nJungle by Pink Shark\nLicensed from Triple Scoop Music ►\nhttps://triplescoopmusic.com/\n\nPurchases made through some store links may provide some compensation to Hacksmith.\n\nWARNING: THESE VIDEOS ARE FOR ENTERTAINMENT PURPOSES ONLY. PERSONAL USE OF VIDEO CONTENT IS AT YOUR OWN RISK. THE HACKSMITH IS A TRAINED PROFESSIONAL WHO KNOWS EXACTLY WHAT HE'S DOING. EXCEPT WHEN HE DOESN'T. DO NOT ATTEMPT TO RECREATE OR RE-ENACT ANYTHING SHOWN IN THESE VIDEOS.\n\n#starwars #lightsaber #makeitreal",
